import FocusedDataItem from "./focusedDataItem"

let focusedDataTitle = {
  backgroundColor: "#4382BC",
  color: "white",
  textAlign: "center",
}

//Extends Focused
export default function FocusedData({focusedItem}) {
  return (
    <div style={{width: "97%", margin: "12px auto 0px auto", border: "1px solid #4382BC", height: "71%"}}>
      <div style={focusedDataTitle}>Profile</div>
      <div style={{width: "100%", height: "96.5%", overflowY: "scroll"}}>
        <div 
          style={{
            backgroundColor: "white", 
            fontSize: "11px",
            paddingBottom: "3px"
          }}>
          <FocusedDataItem itemObject={focusedItem.data}/>
        </div>
      </div>
    </div>
  )
}
